// 現在のページを取得する。
var page = Forguncy.Page;
// 現在のページでatesaki_kouhoセルを取得する。
var atesakikouhocell = page.getCell("atesaki_kouho");
// getValueメソッドでatesaki_kouhoセルの値を取得する。
var atesakikouhocellValue = atesakikouhocell.getValue();
// atesaki_kouhoを配列にする
var atesakikouhoitem = atesakikouhocellValue.split(',');
// 現在のページでatesaki_kouho_itijiという名前のセルを取得する。
var atesakikouhoitijicell = page.getCell("atesaki_kouho_itiji");
// getValueメソッドでatesaki_kouho_itijiセルの値を取得する。
var atesakikouhoitijicellValue = atesakikouhoitijicell.getValue();
// atesaki_kouho_itijiを配列にする
var atesakikouhoitijiitem = atesakikouhoitijicellValue.split(',');

// リストuを作成
var u = [];

// atesakikouhoitemの数を繰り返して、atesakikouhoitijiitemの中にあれば、uにUSERのMJSIDを追加
atesakikouhoitem.forEach(function(user, index) {
	var result = atesakikouhoitijiitem.includes(user);
	if(result) {
		u.push(user);
	}
});

// uをカンマ区切りにしてurに格納
var ur = u.join( ',' );

// urの値をatesaki_kouhosentakuに
Forguncy.Page.getCell("atesaki_kouhosentaku").setValue(ur);

